import Link from "next/link";
import useSWR from "swr";

function fetcher(url) {
  fetch(url)
    .then(r => r.text())
    .then(console.log);
}
export default function Index() {
  const { data, error } = useSWR("/api/taest", fetcher);

  if (error) throw error;
  console.log(data, error);
  return (
    <>
      <h1>Response: {data}</h1>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
